import React, { Component } from "react";
import "./Procedure.css";

class Procedure extends Component {

  render() {

    const procedure = [
      "Wash hands w/ soap", 
      "Put day x supplies on clean surface outside bathroom",
      "Fresh clean towel & trash bag in bathroom",
      "Shower, remove, gently wash",
      "Dry body and wound then go to set up",
      "Pat dry w/wound gauze or qtip",
      "Cut non-stick dressing then open vaseline",
      "Using 2 qtips thickly “ice” wound with vaseline",
      "Cover with gauze and tape on",
      "See you tomorrow"
    ];

    return (
      <div className="procedure mt-5">
        <h2 className="text-white">Procedure</h2>
        <hr/>

        <div class="carousel slide" data-ride="carousel">
   <      div class="carousel-inner">
            <div class="carousel-item active">
              <div class="row">
               <div class="col"><img src=".." alt="1 slide" /></div>
               <div class="col"><img src=".." alt="2 slide" /></div>
               <div class="col"><img src=".." alt="3 slide" /></div>
              </div>
              <div class="row">
               <div class="col"><img src=".." alt="4 slide" /></div>
               <div class="col"><img src=".." alt="5 slide" /></div>
               <div class="col"><img src=".." alt="6 slide" /></div>
              </div>
       </div>
   </div>
</div>


        <ul className="list-group list-group-horizontal  mt-2">
          {procedure.map((step, i) => 
            <li key={i} className="list-group-item">{step}</li>
          )}
        </ul>
      </div>
    );
  }
}

export default Procedure;
